    [],nt"num_tags": 6,nt"name": "reconnaissance-of-major-redhead-duck-production-areas-in-six-western-states",nt"isopen":
    false,nt"url": null,nt"notes": "On May 20, 1979 I flew commercial from
    the Twin Cities, Minnesota to Salt  Lake City, Utah to begin a whirlwind tour of
    major redhead production  areas in Utah, Nevada, California, Oregon, Idaho and Montana.
    A major  purpose of this trip was to look at important nesting areas for the  western
    population of the redhead during the peak of the nesting season.  Equally important,
    I wanted to discuss with those most familiar with the  situation, the past and present
    status of the redhead - its habitat, its  breeding biology and its relationship
    to the canvasback. I intend to  draw on the information obtained in a manuscript
    on the redhead now in  preparation, so this report covers only the highlights.",nt"owner_org":
